import React from "react";
import {
  Button,
  RadioGroup,
  FormControl,
  FormLabel,
  Sheet,
  Radio
} from "@mui/joy";
export default function PageOne() {
  return (
    <FormControl>
      <FormLabel color="primary">What is your goal?</FormLabel>
      <RadioGroup
        defaultValue="Lose Weight"
        size="lg"
        sx={{ gap: 1.5 }}
      >
        {['512GB', '1TB', '2TB'].map((value) => (
          <Sheet
            key={value}
            sx={{
              p: 2,
              borderRadius: 'md',
              boxShadow: 'sm',
            }}
          >

          </Sheet>
        ))}
      </RadioGroup>
    </FormControl>
  );
}
